Here we are again... Yet again i find myself fallen into the hole that is World of Warcraft..

A friend wanted to level up a toon before Shadowlands hit and wanted some company..So meet Walko! A Gnome Hunter, and i have to admit...Im really enjoying myself, the Hunter is quite fun! Let's see how it feels once im maxlvl but this could very well turn out to be my choice as a main in Shadowlands..

I have always had a bit of a softspot for gnomes i hate to admit..But never really played one as a main. That could change now...

We managed to ding lvl 41 tonight so we can be quite proud of ourselfs...

I also messed around a bit on Classic today. Currently level 9 on my troll warrior and was actually a bit shocked to see how many people that actually plays Classic. Orgrimmar looks like the golden days. However i dont think il be spending much time on Classic, i have done it and seen it like 15 years ago. But nice to see ppl actually play it.

Tomorrow we have quite the hectic day here...Im planning on getting some Dragon Age Origins done later on in the evening however..

